import React from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeOutlinedIcon from '@material-ui/icons/HomeOutlined';
import ForumOutlinedIcon from '@material-ui/icons/ForumOutlined';
import AlternateEmailIcon from '@material-ui/icons/AlternateEmail';
import SearchIcon from '@material-ui/icons/Search';
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import ArrowDropDownCircleIcon from '@material-ui/icons/ArrowDropDownCircle';
import './Home.css';

/**
* Simple component with no state.
*
* @return {object} JSX
*/
function Home() {
  return (
    <div>
      <div id='header'>
        CSE183 Summer 2021
        <ArrowDropDownCircleIcon id='header-arrow'/>
      </div>
      <div id='channel-body'>
        <div id='channels-header'>
          <ArrowDropDownCircleIcon id='body-arrow' fontSize='small'/>
          Channels
        </div>
        <div id='channel' style={{display: 'none'}}>
          <div># Assignment</div>
        </div>
        <div id='dm-header'>
          <ArrowDropDownCircleIcon id='body-arrow' fontSize='small'/>
          Direct Messages
        </div>
      </div>
      <BottomNavigation id='navigation'>
        <BottomNavigationAction
          label="" icon={<HomeOutlinedIcon />} />
        <BottomNavigationAction
          label="" icon={<ForumOutlinedIcon />} />
        <BottomNavigationAction
          label="" icon={<AlternateEmailIcon />} />
        <BottomNavigationAction
          label="" icon={<SearchIcon />} />
        <BottomNavigationAction
          label="" icon={<PermIdentityIcon />} />
      </BottomNavigation>
    </div>
  );
}

export default Home;
